In addition to learning the key elements of the After Effects interface, this completely revised CS5 edition covers

64-bit performance;

New Mocha, Color Finesse 3, and Digieffects FreeForm plug-ins;

Roto Brush; AVC-Intra and expanded RED camera support; and more.

